import React from 'react';
import logo from './logo.svg';
import './App.css';
import NavBar from './Components/Navbar/NavBar';
import {Animated} from 'react-animated-css'

function App() {
  return (
    <div className="App">
      Animated animationIn="fadeInDown">
      <NavBar />
    </div>
  );
}

export default App;
